import { dropDownList } from '../../dropDownList/dropDownList';

const initialState = {
    dropDownList
}

const reducer = (state = initialState, action) => {
    console.log('STATE: ', state)
    switch (action.type) {
        default:
            return state;
    }
};

export default reducer;
